enableOnAR.description:
Disabled: entity will always be disabled during AR session;
        Always: entity will always be enabled during AR session, regardless if XR is available;
        On Tracking: entity will only be enabled after the AR session has started tracking.

spaceType.description:
Reference space type. Can be one of the following:
        XRSPACE_VIEWER: Viewer - always supported space with some basic tracking capabilities;
        RSPACE_LOCAL: Local - represents a tracking space with a native origin near the viewer at the time of creation. It is meant for seated or basic local XR sessions;
